import React from "react";
import altlogo from "../img/Hospital Logo.png";
const Footer = () => {
  return (
    <footer className="text-center bg-dark p-2" style={{ marginTop: "30px" }}>
      <img src={altlogo} alt="Logo" class="logo" />
      <p className="text-light mt-0">Copyright 2022</p>
    </footer>
  );
};

export default Footer;
